import './App.css';
import Login from './page/login/Login';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from './page/home/Home';
function App() {
  return (
   <Router>

       <Route exact path="/">
          <Home/>
       </Route>
       <Route exact path="/Login">
          <Login/>
       </Route>

   </Router>
  );
}

export default App;
